import java.util.*;

/**
 * @author Andy_Wang
 * @version 1.0
 * @description: 1456. 定长子串中元音的最大数目  中等  字符串 滑动窗口
 * 自己写出了一个解，100/107，最后是时间过长没有通过
 * kimi给出的优化解，不用便利每一个值，只需要看两头是否是元音字母即可对应+1或者-1
 * @date 2024/12/8 10:15
 */
public class maxVowels {
    public static int maxVowels_kimi(String s, int k) {
        int res = 0;
        int n = s.length();
        List<Character> vowels = new ArrayList<>();
        vowels.add('a');
        vowels.add('e');
        vowels.add('i');
        vowels.add('o');
        vowels.add('u');

        int count = 0; // 用于记录当前窗口中的元音数量
        for (int i = 0; i < k; i++) {
            if (vowels.contains(s.charAt(i))) {
                count++;
            }
        }
        res = Math.max(res, count); // 更新结果

        for (int i = k; i < n; i++) {
            // 左边界字符出窗口，如果是元音，计数器减一
            if (vowels.contains(s.charAt(i - k))) {
                count--;
            }
            // 右边界字符进窗口，如果是元音，计数器加一
            if (vowels.contains(s.charAt(i))) {
                count++;
            }
            res = Math.max(res, count); // 更新结果
        }
        return res;
    }
    public static int maxVowels(String s, int k) {
        int res=0;
        int n=s.length();
        //Deque<Character> deque=new ArrayDeque<>();
        List<Character> vowels=new ArrayList<>();
        vowels.add('a');
        vowels.add('e');
        vowels.add('i');
        vowels.add('o');
        vowels.add('u');
        int i=0;

        for(i=0;i<(n-k+1);i++){
            int temp=0;
            String str=s.substring(i,i+k);
            for(int j=0;j<str.length();j++){
                if(vowels.contains(str.charAt(j))){
                    temp=temp+1;
                }
            }
            res=Math.max(res,temp);
        }
        return res;
    }
    public static void main(String[] args) {
        String s1="abciiidef";
        int k1=3;
        String s2="aeiou";
        int k2=2;
        String s3="leetcode";
        int k3=3;
        String s4="rhythms";
        int k4=4;
        String s5="tryhard";
        int k5=4;
        System.out.println(maxVowels(s1,k1));
        System.out.println(maxVowels(s2,k2));
        System.out.println(maxVowels(s3,k3));
        System.out.println(maxVowels(s4,k4));
        System.out.println(maxVowels(s5,k5));
        System.out.println("-------------------------");
        //String s6="";
        //System.out.println(s6.length());
    }
}
